import React from 'react';
import './Money.css';
import Bill from './Bill';
import Coin from './Coin';
import { FaMoneyBill, FaBitcoin } from 'react-icons/fa';

const bank_type = [

    {
            type : '฿20',
            amount: 100,
        },
    {
            type : '฿50',
            amount: 50,
        },
        {
            type : '฿100',
            amount: 50,
        },
        {
            type : '฿500',
            amount: 20,
        },
        {
            type : '฿1000',
            amount: 20,
        }


];

const coin_type = [

    {
            type : '฿1',
            amount: 100,
        },
    {
            type : '฿2',
            amount: 50,
        },
        {
            type : '฿5',
            amount: 50,
        },
        {
            type : '฿10',
            amount: 20,
        },



];

function Money() {
    const showBill = bank_type.map((bill)=> <Bill id={bill.type} type={bill.type} amount={bill.amount}/>)
    const showCoin= coin_type.map((coin)=> <Coin id={coin.type} type={coin.type} amount={coin.amount}/>)
    return (
        <div className="Money">
            <table className="BillTable">
                <tr>
                    <td>
                        <tr className='InnerTr'>
                            <center><FaMoneyBill className='billIcon'/></center>
                        </tr>
                        <tr className='InnerTr'>
                            <p className="moneyEle amountEle">Amount:</p>
                        </tr>


                    </td>
                {showBill}
                </tr>

            </table>

            <table className="CoinTable">
                <tr>
                    <td>
                        <tr className='InnerTr'>
                            <center><FaBitcoin className='coinIcon'/></center>
                        </tr>
                        <tr className='InnerTr'>
                            <p className="moneyEle amountEle">Amount:</p>
                        </tr>


                    </td>
                {showCoin}
                </tr>

            </table>


        </div>
    );
}

export default Money;
